import logo from './logo.svg';
import './App.css';
import FileWindow from './Components/FileWindow.js';
import OpeningFile from './Components/OpeningFile.js';
import OpeningFileIcon from './Components/OpeningFileIcon.js';

function App() {
  return (
    <div class="h-screen w-screen bg-black">
      <OpeningFileIcon />
      <OpeningFile />
    </div>
  );
}

export default App;
